import { Component } from "react";
import FormText from "./FormText";
import FormDate from "./FormDate";
import FormPhone from "./FormPhone";
import FormEmail from "./FormEmail";
import { FormSelector } from "./FormSelector";
export default class BuildForm  {
  render() {
    // Récupérer les données passées via props
    const { data } = this.props;

    return (
      <div>
      {data.context.map((e) => {

        switch (e.type) {
          case 'text':
          return <FormText data={e}/>;
          case 'date':
          return <FormDate data={e}/>;
          case 'phone':
          return <FormPhone data={e}/>;
          case 'email':
          return <FormEmail data={e}/>;
          case 'selector':
          return <FormSelector data={e}/>;
          default:
          return <p>{e.type} : {e.title}</p>;
        }
      })
    }
    </div>

  )
}
}
